import styled from "styled-components";

export const ContactContainer = styled.div`
    position: relative;
    height: 100%;
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
`;

export const ContactContent = styled.div`
    padding: 20px;
`;
